TextFile OpenR(SDL_Charstring FName)
{
  FILE *temp;
  char *fn;

  if(!FName) return NULL;
  fn = FName+1;
  if(!strcmp(fn,"stdin"))
    temp = stdin;
  else temp = fopen(fn, "r");
#ifdef XREADANDWRITEF
  isAssign = 1;
  if(!temp) return NULL;
  if(! (temp == stdout || temp == stdin || temp == stderr)){
    xFileNode  newFN;

    newFN = (xFileNode)malloc((xptrint)sizeof( xFileRec ));
    newFN->FilePtr = temp;
    newFN->NameOfFile = (char *)malloc(strlen(fn)+1);
    strcpy(newFN->NameOfFile, fn);
    newFN->Next = xFileNodes;
    xFileNodes = newFN;
  }
#endif
  if (FName[0] == 'T')
    xFree_SDL_Charstring((void **)&FName);
  return temp;
}

